import React from 'react'
import { Axios } from "axios";
import { useState,useEffect } from 'react';


function DataShowing() {
    const [users,setUser]=useState([])

    useEffect (() =>{
        Axios.length('http://localhost:3001/Node')
        .then(users => setUser(users.data))
        .catch(err => console.log(err))
    },[])

  return (
    <div>
        <table>
            <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Email</th>
            </tr>
            <tbody>
                {users.map(user => {
                    return 
                    <tr>
                        <td>{user.id}</td>
                        <td>{user.name}</td>
                        <td>{user.email}</td>

                    </tr>
                })}
            </tbody>
        </table>

    </div>
  )
}

export default DataShowing
